import React from 'react';
import Lobby from './Lobby';

class Switch extends React.Component {
	constructor(props) {
		super(props);
		this.state = {
			props: this.props,
			props1: this.props.children[1]
		}
	}
	componentDidMount() {
		console.log('alalal');
		console.log(this.state.props1);
	}
	render() {
		return (
			<div>
              { this.props.children }
			</div>
		)
	}
}

class Router extends React.Component {
  render() {
    return(
      <Switch>
        <li><Lobby/></li>
        <li><p>Salu</p></li>
      </Switch>
	)
  }
}

export default Router;
